import React, { useState, useEffect, useContext } from "react";
import { Typography, Button, FormGroup, FormControlLabel, Checkbox } from '@material-ui/core';

import { Context } from '../Context';
import Navbar from "../Navbar";
import useStyles from '../styles';

function Account() {
  const {
    accountState,
    setAccountState,
    getAccountInfo
  } = useContext(Context);

  const {
    acc_id,
    branch_id,
    employee_id,
    email,
    username,
    first_name,
    last_name,
    hp,
    mgr_id,
    role_id,
    store_id,
    type_id,
  } = accountState;

  useEffect(() => {
    getAccountInfo();
  }, []);

  const styles = useStyles();

  const AccountInfo = (props) => {
    if (props.info != null) {
      return <Typography>{props.category}: {props.info}</Typography>;
    } else {
      return null;
    };
  };

  return (
    <main className={styles.main}>
      <Navbar />
      <br />
      <Typography variant="h3" align='center'>Account</Typography>
      <br />
      <Typography className={styles.accountInfo}>Account ID: {acc_id}</Typography>
      <AccountInfo category="Account ID" info={acc_id}/>
      <Typography align='center'>Employee ID: {employee_id}</Typography>
      <Typography align='center'>Email: {email}</Typography>
      <Typography align='center'>Username: {username}</Typography>
      <Typography align='center'>First Name: {first_name}</Typography>
      <Typography align='center'>Last Name: {last_name}</Typography>
      <Typography align='center'>Contact Number: {hp}</Typography>
      <Typography align='center'>Role: {role_id}</Typography>
      <Typography align='center'>Mgr ID: {mgr_id}</Typography>
      <Typography align='center'>Store ID: {store_id}</Typography>
      <Typography align='center'>Store Type: {type_id}</Typography>
    </main>
  );
}

export default Account;
